(39,	'zavody',	'2012-01-08 19:08:46',	'jihomoravsky',	'2012-05-01 00:00:00',	'popis',	'AgilityAmikea@seznam.cz',	'8bd94feba7deeec3c3e71d22d0475838dcd8673f',	'80.251.246.198',	'',	'{\"title\":\"Popis\",\"date\":\"2012-05-01 00:00:00\",\"duration\":0,\"location\":\"KK Vesel\\u00ed nad Moravou\\nLoc: 48\\u00b057\\u00b452.199\\\"N, 17\\u00b023\\u00b422.997\\\"E\",\"state\":\"jihomoravsky\",\"info\":\"\\n\\t\\nNeobvykl\\u00e9 z\\u00e1vody agility Vesel\\u00ed nad Moravou\\nDvojit\\u00e9 Vesel\\u00ed\\u010dko\\nDatum kon\\u00e1n\\u00ed: 1.5.2012\\nM\\u00edsto kon\\u00e1n\\u00ed: Vesel\\u00ed nad Moravou Loc: 48\\u00b057\\u00b452.199\\\"N, 17\\u00b023\\u00b422.997\\\"E\\nRozhod\\u010d\\u00ed: Ka\\u010dka Pechov\\u00e1 a Ka\\u010dka Suchovsk\\u00e1\\nStartovn\\u00e9: 200,- K\\u010d, za ka\\u017ed\\u00e9ho dal\\u0161\\u00edho psa 50,- K\\u010d\\nPlatba p\\u0159evodem na \\u00fa\\u010det \\u010d. 86-2535740207\\/0100\\nDo zpr\\u00e1vy pro p\\u0159\\u00edjemce: Jm\\u00e9no a P\\u0159\\u00edjmen\\u00ed psovoda.\\nVa\\u0161e p\\u0159ihl\\u00e1\\u0161ka bude p\\u0159ijata a\\u017e po zaplacen\\u00ed startovn\\u00e9ho.\\nProgram: 7:30 \\u2013 8:00 p\\u0159ej\\u00edmka\\n8:00 \\u2013 prohl\\u00eddka parkuru\\n2x b\\u011bh \\u0161t\\u011b\\u0148\\u00e1tek\\nVYHL\\u00c1\\u0160EN\\u00cd\\nJump - za\\u010d\\u00e1te\\u010dn\\u00edci\\nJump \\u2013 za\\u010d\\u00e1te\\u010dn\\u00edci\\nVYHL\\u00c1\\u0160EN\\u00cd\\nAgility \\u2013 pokro\\u010dil\\u00ed\\nAgilty \\u2013 pokro\\u010dil\\u00ed\\nHRA pro handlery \\\"p\\u0159ekvapen\\u00ed na m\\u00edst\\u011b\\\" (hra je dobrovoln\\u00e1 pro dvojice)\\nVYHL\\u00c1\\u0160EN\\u00cd\\nVyhl\\u00e1\\u0161en\\u00ed ihned po dob\\u011bhnut\\u00ed, Vyhodnocuj\\u00ed se jednotliv\\u00e9 b\\u011bhy a pot\\u00e9 i sou\\u010dty.\\nPO\\u010cET STARTUJ\\u00cdC\\u00cdCH JE OMEZEN NA 70 T\\u00ddM\\u016e.\\nP\\u0159ihl\\u00e1\\u0161ku pos\\u00edlat na e-mail AgilityAmikea@seznam.cz\\nUz\\u00e1v\\u011brka p\\u0159ihl\\u00e1\\u0161ek do 6. 4. 2012 nebo po napln\\u011bn\\u00ed stavu.\\nPravidla:\\n\\u0160t\\u011b\\u0148ata: 2 b\\u011bhy\\nv\\u011bk do 18m\\u011bs\\u00edc\\u016f\\ntunelov\\u00fd a barelov\\u00fd b\\u011bh\\nZa\\u010d\\u00e1te\\u010dn\\u00edci: 2 b\\u011bhy \\u2013 Jumping (tzn. bez z\\u00f3nov\\u00fdch p\\u0159ek\\u00e1\\u017eek a slalomu)\\npro pejsky, kte\\u0159\\u00ed se je\\u0161t\\u011b nez\\u00fa\\u010dastnili ofici\\u00e1ln\\u00edch z\\u00e1vod\\u016f\\nPokro\\u010dil\\u00ed: 2 b\\u011bhy - Agility (posuzov\\u00e1n\\u00ed dle \\u0159\\u00e1du KA \\u010cR)\\npro v\\u0161echny pejsky, kte\\u0159\\u00ed se ji\\u017e z\\u00fa\\u010dastnily ofici\\u00e1ln\\u00edch z\\u00e1vod\\u016f\\nPodm\\u00ednky \\u00fa\\u010dasti\\nO\\u010dkovac\\u00ed pr\\u016fkazy s platn\\u00fdm povinn\\u00fdm o\\u010dkov\\u00e1n\\u00edm.\\nMajitel h\\u00e1rav\\u00e9 feny je povinen ozn\\u00e1mit tuto skute\\u010dnost po\\u0159adateli p\\u0159i prezenci.\\nKa\\u017ed\\u00fd \\u00fa\\u010dastn\\u00edk zodpov\\u00edd\\u00e1 za \\u0161kody zp\\u016fsoben\\u00e9 sv\\u00fdm psem a je povinen ukl\\u00edzet po sv\\u00e9m psovi.\\nPes, kter\\u00fd m\\u00e1 proveden kosmetick\\u00fd z\\u00e1krok na u\\u0161\\u00edch, se nesm\\u00ed z\\u00e1vod\\u016f z\\u00fa\\u010dastnit.\\nKa\\u017ed\\u00fd \\u00fa\\u010dastn\\u00edk je povinen \\u0159\\u00eddit se z\\u00e1konem 246\\/1992 Sb., v platn\\u00e9m zn\\u011bn\\u00ed na ochranu zv\\u00ed\\u0159at proti t\\u00fdr\\u00e1n\\u00ed.\\nV are\\u00e1lu cvi\\u010di\\u0161t\\u011b bude zaji\\u0161t\\u011bno ob\\u010derstven\\u00ed.\\nT\\u011b\\u0161\\u00edme se na V\\u00e1s\",\"contact\":\"AgilityAmikea@seznam.cz\"}'),
