(49,	'zavody',	'2012-01-27 13:34:18',	'kralovehradecky',	'2012-08-18 00:00:00',	'miniagility special civava cup 2012',	'alena.zbozinkova@gmail.com',	'f5499c1a7edc56d38eb533777f3cca773847b127',	'193.86.242.34',	'',	'{\"title\":\"Miniagility speci\\u00e1l \\u010cIVAVA CUP 2012\",\"date\":\"2012-08-18 00:00:00\",\"duration\":0,\"location\":\"Are\\u00e1l Nov\\u00fd Sv\\u011bt ve Dvo\\u0159e Kr\\u00e1lov\\u00e9 nad Labem\",\"state\":\"kralovehradecky\",\"info\":\"\\nKategorie:\\n* Za\\u010d\\u00e1te\\u010dn\\u00edci XS (do 27 cm v kohoutku)\\n* Za\\u010d\\u00e1te\\u010dn\\u00edci Small (do 35 cm v kohoutku)\\n* Pokro\\u010dil\\u00ed XS (do 27 cm v kohoutku)\\n* Pokro\\u010dil\\u00ed Small (do 35 cm v kohoutku)\\nNa z\\u00e1v\\u011br bude agility hra pro v\\u0161echny kategorie dohromady. Sout\\u011b\\u017eit se bude ale i o zvl\\u00e1\\u0161tn\\u00ed ceny!\\nKde n\\u00e1s najdete:\\nPojedete-li ze sm\\u011bru Hradec Kr\\u00e1lov\\u00e9 nebo Trutnov, pokra\\u010dujte po hlavn\\u00edm tahu (300) sm\\u011brem na Prahu a za autobusov\\u00fdm n\\u00e1dra\\u017e\\u00edm p\\u0159ed benzinovou pumpou \\u00d6MV (v\\u0161e po lev\\u00e9 stran\\u011b) zabo\\u010dte vlevo. Pojedete st\\u00e1le vp\\u0159ed po panelov\\u00e9 cest\\u011b. Pojedete-li ze sm\\u011bru Praha nebo Ji\\u010d\\u00edn, odbo\\u010d\\u00edte na kruhov\\u00e9m objezdu v p\\u0159\\u00edm\\u00e9m sm\\u011bru p\\u0159es most (ve sm\\u011bru od ZOO je to odbo\\u010dka vlevo) a budete pokra\\u010dovat po hlavn\\u00ed. Za benzinovou pumpou \\u00d6MV odbo\\u010d\\u00edte doprava a d\\u00e1le vp\\u0159ed po panelov\\u00e9 cest\\u011b.\",\"contact\":\"\\\"www.minimaxipes.estranky.cz\\\":http:\\/\\/www.minimaxipes.estranky.cz\\/clanky\\/kontakty.html\"}'),
