(101,	'zavody',	'2012-11-05 19:50:06',	'jihomoravsky',	'2013-03-30 00:00:00',	'jarni tlapkovani',	'petr.vlasic@seznam.cz',	'b1f5d738f741c0f60578b74ac4f7e4fe0b97a82b',	'93.92.51.138',	'',	'{\"title\":\"JARN\\u00cd TLAPKOV\\u00c1N\\u00cd\",\"date\":\"2013-03-30 00:00:00\",\"duration\":0,\"location\":\"Sedlec u Mikulova\",\"state\":\"jihomoravsky\",\"info\":\"\\nAgility klub Flying Paws Sedlec ( L\\u00e9taj\\u00edc\\u00ed tlapky ), Obec Sedlec a jednotka SDH Sedlec V\\u00e1s srde\\u010dn\\u011b zvou na neofici\\u00e1ln\\u00ed z\\u00e1vody v agility pojmenovan\\u00e9 Jarn\\u00ed tlapkov\\u00e1n\\u00ed, kter\\u00e9 se uskute\\u010dn\\u00ed 30. b\\u0159ezna 2013 na fotbalov\\u00e9m h\\u0159i\\u0161ti v Sedleci.  B\\u011bhy pro \\u0161t\\u011bnda, za\\u010d\\u00e1te\\u010dn\\u00edky, z\\u00e1vodn\\u00edky i veto\\u0161ky. Op\\u011bt bude p\\u0159ipraven dopl\\u0148kov\\u00fd b\\u011bh \\u2013 O MISTRA TLAPEK \\u2013 parkur v obt\\u00ed\\u017enosti A3. Pro um\\u00edst\\u011bn\\u00e9 budou p\\u0159ipraveny ji\\u017e tradi\\u010dn\\u011b kr\\u00e1sn\\u00e9 ceny ( medaile za jednotliv\\u00e9 b\\u011bhy, poh\\u00e1ry za sou\\u010dty ). Pro ka\\u017ed\\u00e9ho drobnost p\\u0159i prezenci.\\nOstatn\\u00ed: kryt\\u00e9 p\\u00e1rty stany, velk\\u00e1 parkovac\\u00ed plocha, elektronick\\u00e1 \\u010dasom\\u00edra a pr\\u016fb\\u011b\\u017en\\u00fd v\\u00fdsledkov\\u00fd servis na LCD, zvukov\\u00e1 aparatura, nov\\u00e9 toalety, ob\\u010derstven\\u00ed zaji\\u0161t\\u011bno.\\nP\\u0159ihla\\u0161ov\\u00e1n\\u00ed bude spu\\u0161t\\u011bno jako d\\u00e1rek na \\u0160t\\u011bdr\\u00fd den \\u2013 24.12.2012, kdy uve\\u0159ejn\\u00edme  propozice z\\u00e1vod\\u016f i p\\u0159ihl\\u00e1\\u0161ku.\\n\\\"www.flyingpaws.webnode.cz\\\":http:\\/\\/www.flyingpaws.webnode.cz\\n\",\"contact\":\"Vla\\u0161ic Petr\\nTel: 737 96 10 16\\nE-mail: petr.vlasic@seznam.cz\"}'),
