(126,	'soustredeni',	'2011-12-31 15:34:41',	'jihomoravsky',	'2012-03-17 00:00:00',	'intenzivni trenink s luckou dostalovou',	'barbora.mandikova@gmail.com',	'066ed9a9f26dc6fbfae9300c2390b9bfb543849d',	'88.101.77.9',	'',	'{\"title\":\"Intenzivn\\u00ed tr\\u00e9nink s Luckou Dost\\u00e1lovou\",\"date\":\"2012-03-17 00:00:00\",\"dateTo\":\"2012-03-17 00:00:00\",\"location\":\"hala st\\u00e1je Hlavenka - Mikulov\",\"state\":\"jihomoravsky\",\"info\":\"\\nm\\u00edsto kon\\u00e1n\\u00ed:Mikulov, hala st\\u00e1je Hlavenka\\nkdy: sobota a ned\\u011ble 17.-18.3.2012, 8:00 - 18:00\\ntren\\u00e9rka: Lucie Dost\\u00e1lov\\u00e1\\ncena: 800,- za cel\\u00fd v\\u00edkend\\npo\\u010det tr\\u00e9nuj\\u00edc\\u00edch:14 t\\u00fdm\\u016f \\nP\\u0159ihla\\u0161ov\\u00e1n\\u00ed je mo\\u017en\\u00e9 pouze na oba dny. V\\u00fdhradn\\u00ed pr\\u00e1vo na p\\u0159ihl\\u00e1\\u0161en\\u00ed (zaplacen\\u00ed) maj\\u00ed P\\u0159ihla\\u0161ov\\u00e1n\\u00ed mo\\u017en\\u00e9 pouze na oba dny. Po p\\u0159ihl\\u00e1\\u0161en\\u00ed je nutn\\u00e9 zaplatit intenzivku neprodlen\\u011b. Pokud tak z\\u00e1jemce o tr\\u00e9nink neu\\u010din\\u00ed nejpozd\\u011bji do dvou dn\\u016f, bude automaticky ze seznamu vy\\u0159azen a m\\u00edsto bude nab\\u00eddnuto dal\\u0161\\u00edmu z\\u00e1jemci!!!\\npodm\\u00ednky: Pejsci mus\\u00ed m\\u00edt v\\u0161echna platn\\u00e1 o\\u010dkov\\u00e1n\\u00ed a mus\\u00ed b\\u00fdt zdrav\\u00ed, v\\u00fdhodou je dobr\\u00e1 n\\u00e1lada a chu\\u0165 se nau\\u010dit n\\u011bco nov\\u00e9ho, p\\u0159\\u00edpadn\\u011b se je\\u0161t\\u011b o n\\u011bco m\\u00e1lo v\\u00edce zdokonalit v agility. Psovod je zodpov\\u011bdn\\u00fd za v\\u0161echny \\u0161kody zp\\u016fsoben\\u00e9 sv\\u00fdm psem a je povinen ukl\\u00edzet v\\u0161echny t\\u00fdmov\\u00e9 exkrementy v are\\u00e1lu a pod\\u00e9l cest.\\nprogram: Tr\\u00e9ninky jsou ur\\u010deny v\\u0161em \\u2013 \\u0161t\\u011b\\u0148ata, za\\u010d\\u00e1te\\u010dn\\u00edci, pokro\\u010dil\\u00ed, z\\u00e1vodn\\u00edci a budou zam\\u011b\\u0159eny zejm\\u00e9na na praktickou \\u010d\\u00e1st \\u2013 tedy vlastn\\u00ed tr\\u00e9nink na p\\u0159ek\\u00e1\\u017ek\\u00e1ch. Tr\\u00e9nink bude prob\\u00edhat v mal\\u00fdch skupink\\u00e1ch, kter\\u00e9 se budou st\\u0159\\u00eddat na parkuru v\\u017edy po ur\\u010dit\\u00e9m \\u010dasov\\u00e9m limitu. \\nplatba: cenu uhra\\u010fte na \\u00fa\\u010det \\u010d.670100-2208591507\\/6210 var. symbol: 12031718 a zasl\\u00e1n\\u00ed potvrzen\\u00ed o platb\\u011b na email info@jumpingdogs.cz, p\\u0159ihl\\u00e1\\u0161ka bude akceptov\\u00e1na a\\u017e po zaplacen\\u00ed !\\nubytov\\u00e1n\\u00ed: zaji\\u0161\\u0165uje si ka\\u017ed\\u00fd s\\u00e1m - \\\"www.jkmikulov.cz\\\":http:\\/\\/www.jkmikulov.cz \\n\",\"contact\":\"info@jumpingdogs.cz\\n\\\"http:\\/\\/www.jumpingdogs.cz\\\":http:\\/\\/www.jumpingdogs.cz\\/intenzivky.html\\n\"}'),
